import { Button } from './Btn'

 export const Player11 = createContext();

export const Player1 = (setData1) => {

    function play(){
        let play11=Math.floor(Math.random()*7)+ Math.floor(Math.random()*7)
        console.log(play11)
        document.getElementById('rollinfo1').innerText=play11
    }
    console.log(play.play11)
    let p11 = play.play11
    useEffect(() => {
        setData1
    })

    return (
      <Player11.Provider value={p11}>
        <div id="Player1">
          <p>
            Player Rolled:<span id="rollinfo1"></span>
          </p>
          <button onClick={play}> Play1 </button>
        </div>
      </Player11.Provider>
    );


}
